import Container from 'react-bootstrap/Container';

function HeaderComponent({content}) {
    return (
        <header id="header" className="pageHeader d-flex flex-column justify-content-center">
            <Container>
                {content.map((index) => (
                    <h1 key={index} className='text-light display-1 fw-bold'>{index.title}</h1>
                ))}
                {content.map((index) => (
                    <p key={index} className='text-light lead'>{index.subtitle}</p>
                ))}
                {content.map((index) => (
                    <a key={index} className='w-max bg-primary rounded-2 text-light py-2 px-3 text-decoration-none' href={index.href}>{index.cta}</a>
                ))}
            </Container>
        </header>
    );
}

export default HeaderComponent;
